import React, { Component } from "react";
import "./App.css";
import SearchBar from './components/SearchBar'

function App() {
  const headingStyle = {
    color: "white",
    fontWeight: "bold",
    alignText: "center",
    fontSize: "80px",
    opacity: 1,
  }

  return (
    <div className="App">
      <div class="image">
        <h1 style={headingStyle}>Urban Food</h1>
        <h2>Discover the best food & drinks in Toronto, ON</h2>
        <SearchBar/>
      </div>

    </div>
  );
}


export default App;
